import React, { useState } from "react";
import { Box, FormControl, InputLabel, MenuItem, Select, Typography, Button } from "@mui/material";


import { styled } from "@mui/system";
import { useFormik } from "formik";
import { Link } from "@mui/material";
import { GoogleMap, LoadScript } from "@react-google-maps/api";

const Profile = () => {
  // const dispatch = useDispatch();
  // const navigate = useNavigate();
  // const [loading, setLoading] = useState(false);
  // const users = useSelector((state) => state.getuser?.getusers);

  const [name, setname] = useState("");
  const [username, setusername] = useState("");
  const [email, setEmail] = useState("");
  const [interest, setInterest] = useState("");
  const [location, setLocation] = useState("");
  const [billingInfo, setBillingInfo] = useState("");
  const StyledTypography = styled(Typography)({
    textTransform: "uppercase",
    textAlign: "center",
    marginBottom: 5,
  });

  const StyledButton = styled(Button)({
    width: "100%",
    marginTop: "1rem",
  });

  const { values, errors, touched, handleChange, handleSubmit, handleBlur } =
    useFormik({
      initialValues: {
        name: "",
        username: "",
        email: "",
        interest: "",
        location: "",
        billingInfo: "",
      },
      // validationSchema: crudopeUser,
      onSubmit: async (values) => {
        //     const [username, setusername] = useState("");
        // const [email, setEmail] = useState("");
        // const [password, setpassword] = useState("");
        // const [rePassword, setrePassword] = useState("");
        // const dispatch = useDispatch();
        //     e.preventDefault();
        //     if (password !== rePassword) {
        //       toast.error("Password does not match");
        //     } else {
        //       signup(dispatch, { username, email, password });
        //       setusername("");
        //       setEmail("");
        //       setpassword("");
        //       setrePassword("");
        //       redirect("/signup")
        //     }
      },
    });

  return (
    <Box
      sx={{
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        minHeight: "100vh",
        backgroundImage:
          "linear-gradient(to right, rgba(132, 250, 176, 0.5), rgba(143, 211, 244, 0.5))",
      }}
    >
      <Box
        sx={{
          width: "100%",
          maxWidth: 550,
          backgroundColor: "white",
          padding: "2rem",
          margin: ".5rem",
          borderRadius: "15px",
        }}
      >
        <Typography variant="h4" sx={{ marginBottom: "1.5rem" }}>
          Profile
        </Typography>
        <form
          onSubmit={handleSubmit}
          style={{ display: "flex", flexDirection: "column" }}
        >
          <Box
            sx={{ display: "flex", flexDirection: "row", marginBottom: "1rem" }}
          >
            <InputLabel
              htmlFor="name"
              sx={{
                marginRight: "1rem",
                minWidth: "120px",
                alignSelf: "center",
              }}
            >
              Name
            </InputLabel>
            <FormControl fullWidth>
              <TextField
                id="name"
                name="name"
                variant="outlined"
                value={values.name}
                onChange={handleChange}
                onBlur={handleBlur}
                error={errors.name && touched.name}
              />
            </FormControl>
          </Box>
          <Box
            sx={{ display: "flex", flexDirection: "row", marginBottom: "1rem" }}
          >
            <InputLabel
              htmlFor="username"
              sx={{
                marginRight: "1rem",
                minWidth: "120px",
                alignSelf: "center",
              }}
            >
              Username
            </InputLabel>
            <FormControl fullWidth>
              <TextField
                id="username"
                name="username"
                variant="outlined"
                value={values.username}
                onChange={handleChange}
                onBlur={handleBlur}
                error={errors.username && touched.username}
              />
            </FormControl>
          </Box>
          <Box
            sx={{ display: "flex", flexDirection: "row", marginBottom: "1rem" }}
          >
            <InputLabel
              htmlFor="email"
              sx={{
                marginRight: "1rem",
                minWidth: "120px",
                alignSelf: "center",
              }}
            >
              Email
            </InputLabel>
            <FormControl fullWidth>
              <TextField
                id="email"
                name="email"
                variant="outlined"
                value={values.email}
                onChange={handleChange}
                onBlur={handleBlur}
                error={errors.email && touched.email}
              />
            </FormControl>
          </Box>
          <Box
            sx={{ display: "flex", flexDirection: "row", marginBottom: "1rem" }}
          >
            <InputLabel
              htmlFor="interests"
              sx={{
                marginRight: "1rem",
                minWidth: "120px",
                alignSelf: "center",
              }}
            >
              Interests
            </InputLabel>
            <FormControl fullWidth>
              <InputLabel id="interests-label">Interests</InputLabel>
              <Select
                labelId="interests-label"
                id="interests"
                name="interests"
                multiple
                value={values.interests || []} 
                onChange={handleChange}
                onBlur={handleBlur}
                error={errors.interests && touched.interests}
                variant="outlined"
                renderValue={(selected) => selected.join(", ")}
              >
                <MenuItem value="Food">Food</MenuItem>
                <MenuItem value="Fashion">Fashion</MenuItem>
              </Select>
            </FormControl>
          </Box>
          <Box
            sx={{ display: "flex", flexDirection: "row", marginBottom: "1rem" }}
          >
            <InputLabel
              htmlFor="location"
              sx={{
                marginRight: "1rem",
                minWidth: "120px",
                alignSelf: "center",
              }}
            >
              Location
            </InputLabel>
            <FormControl fullWidth>
              <TextField
                id="location"
                name="location"
                variant="outlined"
                value={values.location}
                onChange={handleChange}
                onBlur={handleBlur}
                error={errors.location && touched.location}
              />
            </FormControl>
          </Box>
          <Box
            sx={{ display: "flex", flexDirection: "row", marginBottom: "1rem" }}
          >
            <InputLabel
              htmlFor="billingInfo"
              sx={{
                marginRight: "1rem",
                minWidth: "120px",
                alignSelf: "center",
              }}
            >
              Billing Info
            </InputLabel>
            <FormControl fullWidth>
              <TextField
                id="billingInfo"
                name="billingInfo"
                variant="outlined"
                value={values.billingInfo}
                onChange={handleChange}
                onBlur={handleBlur}
                error={errors.billingInfo && touched.billingInfo}
              />
            </FormControl>
          </Box>
        </form>
      </Box>
    </Box>
  );
};

export default Profile;
